const Footer = () => {
  const date = new Date();

  return (
    <Fragment>
      <footer className="py-1">
        <p className="text-center mt-1">
          Handmake & Help Ukraine &copy; {date.getFullYear()}, All Rights
          Reserved
        </p>
      </footer>
    </Fragment>
  );
};

export default Footer;
